WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Aupa!

WordPress-ek barne ezaugarri bat du plugin edo gai batek zure gunean akats larri bat eragiten duenean hautematen duena, eta eposta elektroniko automatizatu honekin jakinarazten duena.
###CAUSE###
Lehenik zure (###SITEURL###) webgunera joan eta egiaztatu ea ageriko akatsen bat dagoen. Ondoren, errorea antzeman den orrialdera joan  (###PAGEURL###) eta egiaztatu ea ageriko akatsen bat dagoen.

###SUPPORT###

Zure guneak ondatuta dagoela ematen badu eta ezin baduzu arbelera sartu, WordPress-ek orain "Berreskuratze modu" berezi bat du. Honek zure arbelera modu seguruan sartzeko eta arazoa sakonkiago aztertzeko aukera ematen dizu.

###LINK###

Zure gunea seguru mantentzeko, esteka hau ###EXPIRES### -en iraungiko da. Baina ez kezkatu honengatik: e-posta bidez esteka berri bat jasoko duzu iraungi ondoren errorea berriro gertatzen bada.

Arazo honekin laguntza eskatzen baduzu, ondorengo informazioa emateko eskatu diezazuekete:
