angeset statusScheduled'=>'Programatuta','themeInstalled'=>'Instalatuta','%1$s is not a valid property of Object.'=>'%1$s ez da objektuaren baliozko propietatea.','You will not be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'Ezin duzu hemendik itxura berririk instalatu zure instalazioak SFTP egiaztagiriak behar dituelako. Oraingoz, mesedez <a href="%s">gehitu itxurak administratzailetik</a>.','categoriesMost Used'=>'Erabilienak','tagsMost Used'=>'Erabilienak','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Sakatu &#8220;Hurrengoa&#8221; botoia zure menuan estekak gehitzen hasteko.','customizer changeset action/button labelSchedule'=>'Programatu','+ Create New Menu'=>'+ Sortu menu berria','Create a menu for this location'=>'Sortu menu berria kokaleku honetarako','Could not open handle for %1$s to %2$s.'=>'Ezin izan da %1$s-en kudeatzailea ireki %2$s-(e)rako.','Add a navigation menu to your sidebar.'=>'Gehitu nabigazio-menu bat zure albo-barrara.','%s has taken over and is currently customizing.'=>'%s(e)k kontrola hartu du eta une honetan pertsonalizatzen ari da.','Take over'=>'Hartu kontrola','Go back'=>'Atzera joan','No changeset found to take over'=>'Ez da aldaketa multzorik aurkitu kontrola hartzeko','Security check failed.'=>'Segurtasun egiaztapenak huts egin du.','Sorry, you are not allowed to take over.'=>'Barkatu, ezin duzu kontrola hartu.','Changeset is being edited by other user.'=>'Beste erabiltzaile bat aldaketa multzoak editatzen ari da.','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'Zerbait txarto joan dela ematen du. Itxaron segundo pare bat eta saiatu berriro.','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'%s dagoeneko gune hau pertsonalizatzen ari da. Mesedez itxaron pertsonalizatzen ari denak buk