ion'=>'Ikusi kokalekua','No themes found. Try a different search.'=>'Ez da itxurarik aurkitu. Saiatu bilaketa desberdin batekin.','Your theme can display menus in one location. Select which menu you would like to use.'=>'Zure itxurak menuak kokaleku bakarrean bistaratu ditzake. Hautatu erabili nahi duzun menua.','Site Name: %s'=>'Gunearen izena: %s','Unsupported value type (%s).'=>'Balio mota hau ez da onartzen (%s).','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaquo; %2$s &#8212; WordPress','Widgets need to be registered using %s, before they can be displayed.'=>'Widgetak %s erabiliz erregistratuta egon behar dute bistaratuak izan aurretik.','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'Kontsultak ez dauka leku-marka kopuru egokirik (%1$d) pasatu diren argumentu kopururako (%2$d).','Link to:'=>'Estekatu hona:','No images selected'=>'Ez da irudirik hautatu','Gallery'=>'Galeria','Displays an image gallery.'=>'Irudi galeria bat bistaratzen du.','Custom HTML Widget'=>'HTML pertsonalizatua widgeta','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'Erabili HTML pertsonalizatu widgeta HTML kode arbitrarioa gehitzeko widgeten gunetara.','Howdy ###USERNAME###,

