era izango duzu egokitzapen perfektua lortzeko.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Egin klik &#8220;Gehitu irudi berria&#8220; botoian zure ordenagailutik irudi-fitxategi bat igotzeko. Zure itxura hobeto dabil goiburuan %s pixeleko tamaina duen irudi bat jarrita &#8212; Igo ostean, irudia mozteko aukera izango duzu egokitzapen perfektua lortzeko.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Egin klik &#8220;Gehitu irudi berria&#8220; botoian zure ordenagailutik irudi-fitxategi bat igotzeko. Zure itxura hobeto dabil goiburuan bideoak duen tamaina bera duen irudi bat jarrita &#8212; Igo ostean, irudia mozteko aukera izango duzu egokitzapen perfektua lortzeko.','%1$s-%2$s'=>'%1$s-%2$s','Minute'=>'Minutua','Hour'=>'Ordua','Time'=>'Ordua','Day'=>'Eguna','Month'=>'Hilabetea','Date'=>'Data','Name for the Visual editor tabVisual'=>'Bisuala','Create New Menu'=>'Sortu menu berria','New Menu'=>'Menu berria','Usage of user levels is deprecated. Use capabilities instead.'=>'Erabiltzaile-mailen erabilera zaharkituta dago. Horren ordez, gaitasunak erabili.','The theme defines itself as its parent theme. Please check the %s header.'=>'Itxurak, guraso-itxura bezala bere burua zehazten du. Mesedez berrikusi %s goiburua.','Meridian'=>'Meridianoa','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Zure itxurak widget guneak baditu, bertan ere menuak gehi ditzakezu. Bisitatu <a href="%s">Widgets panela</a> eta gehitu &#8220;Nabigazio-menu widgeta&#8221;